import React, { useMemo } from 'react';

import  ContentHeader  from '../../components/ContentHeader';
import { useParams } from 'react-router-dom';
import  SelectInput  from '../../components/SelectInput';
import MynaMonitoring from '../../components/MynaMonitoring';

import { Container, Content, Filters } from './styles';

interface IRouteParams {
    job: string;
}

const List: React.FC = () => {
    const { job } = useParams<keyof IRouteParams>() as IRouteParams;

    const title = useMemo(() => {
        return  
        job === 'entry-myna' ? {
            title: 'Myna monitoring',
            lineColor: '#F7931B'
        }   
        :{
            title: 'Cache switch monitoring',
            lineColor: '#E44C4E'
        }
         
    }, [job]);

   

    const months = [
        {value: 7, label: 'Julho'},
        {value: 8, label: 'Agosto'},
        {value: 9, label: 'Setembro'}
    ];

    const years = [
        {value: 2018, label: 2018},
        {value: 2019, label: 2019},
        {value: 2020, label: 2020}
    ];

    return (
        <Container>
        <ContentHeader title ={job} lineColor='#E44C4E'>
            <SelectInput options= {months} />
            <SelectInput options= {years} />
        </ContentHeader>

        <Filters>
                <button 
                    type="button"
                    className=
                    {`tag-filter
                    tag-filter-success`}
                >
                    Success
                </button>

                <button 
                    type="button"
                    className= 
                    {`tag-filter
                    tag-filter-failed`
                    }
                >
                    Failed
                </button>
        </Filters>
        <Content>
            <MynaMonitoring 
                tagColor = "#E44C4E"
                title = "Run 01"
                subtitle = "10/10/2024"
                status = "Success"
            />
        </Content>

    </Container>
    );
    }
export default List;
